<item>
<title>2007-06-22 17:33:11</title>
<link>http://78.46.73.113/wiki/wakka.php?wakka=DokumentacijaIPStudioAMBS/RazdelOperatory/RazdelOperatorReports/show&amp;time=2007-06-22+17%3A33%3A11</link>
<description>&lt;div class="pageBefore">&lt;img src="http://78.46.73.113/wiki/images/z.gif" width="1" height="1" border="0" alt="" style="display:block" align="top" />&lt;/div>&lt;div class="page">
&lt;b>Сравнение версий &lt;a  href="http://78.46.73.113/wiki/wakka.php?wakka=DokumentacijaIPStudioAMBS/RazdelOperatory/RazdelOperatorReports&amp;amp;v=mja" class="">/Документация&amp;nbsp;IP&amp;nbsp;Studio&amp;nbsp;AMBS&amp;nbsp;/&amp;nbsp;Раздел&amp;nbsp;Операторы&amp;nbsp;/&amp;nbsp;Раздел&amp;nbsp;Operator&amp;nbsp;Reports&lt;/a> за &lt;a href="http://78.46.73.113/wiki/wakka.php?wakka=DokumentacijaIPStudioAMBS/RazdelOperatory/RazdelOperatorReports&amp;amp;time=2007-06-22+17%3A33%3A11">2007-06-22 17:33:11&lt;/a> и &lt;a href="http://78.46.73.113/wiki/wakka.php?wakka=DokumentacijaIPStudioAMBS/RazdelOperatory/RazdelOperatorReports&amp;amp;time=2007-06-26+12%3A51%3A06">2007-06-26 12:51:06&lt;/a>&lt;/b>&lt;br />
&lt;br />
&lt;b>Добавлено:&lt;/b>&lt;br />
&lt;div class="additions">Форма позволяет просмотреть список всех операторов заведенных в&amp;nbsp;системе, адреса, закрепленные за&amp;nbsp;ними тарифы и&amp;nbsp;краткую статистику по&amp;nbsp;их объемам трафика за&amp;nbsp;указанный период времени. Также здесь можно найти нужного оператора по&amp;nbsp;его контрольным параметрам: адрес шлюза, часть почтового адреса, номер icq&amp;nbsp;и&amp;nbsp;т.д. &lt;br />
Для&amp;nbsp;просмотра отчета по&amp;nbsp;всем операторам в&amp;nbsp;системе, достаточно нажать кнопку поиска (&lt;img src="http://78.46.73.113/wiki/files/ambs_bt_find.gif" alt=" (1&amp;nbsp;Кб)" title=" (1&amp;nbsp;Кб)" width='26' height='26' />).&lt;br />
Для&amp;nbsp;того чтобы начать процесс поиска конкретного оператора, нужно задать хотя бы&amp;nbsp;один из&amp;nbsp;параметров оператора и&amp;nbsp;после этого нажать на&amp;nbsp;кнопку поиска. Результат будет представлен в&amp;nbsp;виде сводной таблицы с&amp;nbsp;учетом введенных параметров.&lt;br />
В&amp;nbsp;полученном списке с&amp;nbsp;результатами, названия операторов, тарифы операторов и&amp;nbsp;адреса контактов, при&amp;nbsp;нажатии на&amp;nbsp;них, позволяют перейти в&amp;nbsp;раздел с&amp;nbsp;параметрами выбранного оператора, просмотреть тариф оператора или&amp;nbsp;написать письмо выбранному контакту, соответственно.&lt;/div>&lt;br />
&lt;b>Удалено:&lt;/b>&lt;br />
&lt;div class="deletions">Раздел позволяет просмотреть список всех операторов заведенных в&amp;nbsp;системе, адреса, закрепленными за&amp;nbsp;них тарифы и&amp;nbsp;краткую статистику по&amp;nbsp;их объемам трафика за&amp;nbsp;указанный период времени. Также здесь можно найти нужного оператора по&amp;nbsp;его контрольным параметрам: адрес шлюза, часть почтового адреса, номер icq&amp;nbsp;и&amp;nbsp;т.д. &lt;br />
Для&amp;nbsp;просмотра отчета по&amp;nbsp;все операторам в&amp;nbsp;системе, достаточно нажать кнопку поиска (&lt;img src="http://78.46.73.113/wiki/files/ambs_bt_find.gif" alt=" (1&amp;nbsp;Кб)" title=" (1&amp;nbsp;Кб)" width='26' height='26' />).&lt;br />
Для&amp;nbsp;того, чтобы начать процесс поиска конкретного оператора, нужно задать хотя бы&amp;nbsp;один из&amp;nbsp;параметров оператора и&amp;nbsp;после этого нажать на&amp;nbsp;кнопку поиска. Результат будет представлен в&amp;nbsp;виде сводной таблицы с&amp;nbsp;учетом введенных параметров.&lt;br />
В&amp;nbsp;полученном списке с&amp;nbsp;результатами, названия операторов, тарифы операторов и&amp;nbsp;адреса контактов, при&amp;nbsp;нажатии на&amp;nbsp;них, позволяют перейти в&amp;nbsp;раздел: с&amp;nbsp;параметрами выбранного оператора, просмотреть тариф оператора или&amp;nbsp;написать письмо выбранному контакту, соответственно.&lt;/div>&lt;/div>
</description>
</item>
